import React from 'react';
import { Container, Row,Col} from 'react-bootstrap'; 



export const Teams = () =>(

        <div className="HomeMain">
            <Container >
                  <Row>
                       <Col md={{ span: 6, offset: 3 }}>
                             <h2> Teams page</h2>
                           

                        </Col>
                    </Row>
             </Container>
            
         </div>
    )
export default Teams;
